import React from 'react';
import './cardFeature.css';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import CardFeature from './card_review_feature.js'

function CardFeaturs(){
  return (
    <div className="cardfeaturs">
    {CardFeature.map((item,index)=>{
      return(
        <div>
          <Card>
            <Card.Header>Header</Card.Header>
            <CardBody>
              <CardTitle tag="h4">{item.title}</CardTitle>
              <CardSubtitle  tag="span" className="mb-2">{item.text}</CardSubtitle>
            </CardBody>
          </Card>
        </div>
      )})}
  </div>
  );
};

export default CardFeaturs;
